<script>
import $ from 'jquery'
import EIMZO from "./Modules/EIMZO";

export default {
    name: "Navbar",
    data() {
        return {
            agree: false,
            lang: true,
            authcheck: false,
            user: this.auth.user

        }
    },

    computed:{
        userShorted(){
            return this.user.firstname.charAt(0) + "." + this.user.lastname.charAt(0)
        }
    },


    components: {EIMZO, $},

    methods: {
        agreeToggle() {
            this.agree = !this.agree
        },
        redirect() {
            var client_id = process.env.MIX_CLIENT_ID
            var client_secret = process.env.MIX_CLIENT_SECRET
            var scope = process.env.MIX_SCOPE
            var redirect_uri = process.env.MIX_APP_URL
            window.location.href = "https://sso.egov.uz/sso/oauth/Authorization.do?response_type=one_code&client_id=" + client_id + "&redirect_uri=" +
                redirect_uri + "/oneauth/auth&scope=" + scope + "&state=testState";
        },

        openLang() {
            this.lang = false

        },

        setLocale(locale) {
            this.lang = !this.lang

            this.$i18n.locale = locale
            this.$router.push({
                params: {lang: locale}
            })


        }


    },
    mounted() {
        this.authcheck = localStorage.getItem('authcheck')
        $('.close').click(function (){
            $('.modal').modal('hide')
        })




        $(function () {
            $('#langdropdown').click(function () {
                $('.dropdown-menu').toggle(function () {

                    $('.dropdown-menu').animate(function () {
                        $('.dropdown-menu').css('bottom', '0')
                    }, 1000)

                })
            })
            $('#langlgdropdown').click(function () {
                $('.dropdown-menu').toggle(function () {

                    $('.dropdown-menu').animate(function () {
                        $('.dropdown-menu').css('bottom', '0')
                    }, 500)

                })
            })
            $('.navbar-toggler').click(function () {
                $('#navbarNav').toggle(function () {
                    $('#navbarNav').animate(function () {
                        $('#navbarNav').css('bottom', '0')
                        $('.toggle-line2').css('opacity', 0)
                    })
                })
                $('.toggle-line').toggleClass('border-black')
                $('.toggle-line1').toggleClass('line1')
                $('.toggle-line2').toggleClass('line2')
                $('.toggle-line3').toggleClass('line3')

                $('.dropdown-menu').css('display', 'none')


            })
        })

    }

}
</script>

